import React, { useState } from 'react';


function App() {
const [notes, setNotes] = useState([1, 2, 3, 4, 5, 6, 7, 8, 9]);

let result = (() => {
    for (let elem of notes) {
        return  <input value = {elem} onChange = {(event) => setNotes(event.target.value)}/>
      }

})


return <div>
    {result}
</div>

}
export default App;
